HuaWise Fit provides you with accurate motion recording, heare rate details, sleeping details and multi-sport exercise analysis. Integrate with Health App to achieve data synchronization.Encourage you to love sport and live a healthier life. 

The main features of HuaWise Fit include:
1.Health data display: HuaWise Fit records data relevant to your physical condition such as steps taken, sleep hours, heart rate, calories burned, ECG, and SpO2, and so on;
2.Exercise data analysis: HuaWise Fit is also able to record your multi-sport exercise, and will display various data, including a detailed route and various exercise data analysis afterwards;
3.Smart personal assistant: HuaWise Fit can work as your life assistant, such as message and call notification, watch face replacement, alarm, sedentary reminder, drinking water reminder and so on. You can enjoy a healthy life and discover more fun.
4. Integrate with Health App. After connect the HuaWise Fit App with smart watch, all kind of exercise and healthy data will be synchronized to Helath App. It will be more convenient for these people who have a habit of using Health App to view daily sport data.
